        <Route path='/signup' element={<Auth props={"Sign up"}/>}></Route>
        <Route path="/doctor_details" element={<Auth props={"Doctor"}/>}></Route>
        <Route path="/profile" element={<Profile/>}></Route>
      </Routes>
    </div>
      </BrowserRouter>
  );
}

